import React from "react";
import "./HowToDoDetails.css";
function HowToDoDetails() {
  return (
    <div>
      <h1
        style={{
          textAlign: "center",
          fontFamily: "sans-serif",
          fontSize: "50px",
          marginTop: "25px",
        }}
      >
        How-To-Do
      </h1>
    </div>
  );
}

export default HowToDoDetails;
